import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import jsPDF from "jspdf"; // Import jsPDF
import './clientCases.css'; 
import Header from "../header";
import Footer from "../../components_home/Home_Footer";

function ClientCase() {
    const { nic } = useParams(); // Get NIC from the URL params
    const [cases, setCases] = useState([]);
    const [error, setError] = useState('');

    useEffect(() => {
        // Fetch cases by NIC
        const fetchCases = async () => {
            try {
                const response = await axios.get(`http://localhost:8070/case/get_cases_by_nic/${nic}`);
                setCases(response.data);
            } catch (err) {
                setError("Error fetching cases. Please try again.");
                console.error(err);
            }
        };

        fetchCases();
    }, [nic]);

    // Function to filter complete and pending cases
    const filterCases = (status) => {
        return cases.filter(caseData => caseData.status === status);
    };

    // Function to generate PDF report
    const generatePDF = () => {
        const doc = new jsPDF();
        doc.text("Case Report", 20, 10);
        doc.text("Complete Cases:", 20, 20);

        const completeCases = filterCases('Complete');
        completeCases.forEach((caseData, index) => {
            doc.text(`Case Number: ${caseData.caseNumber}, NIC: ${caseData.nic}`, 20, 30 + (index * 10));
        });

        doc.addPage();
        doc.text("Pending Cases:", 20, 10);
        const pendingCases = filterCases('Pending');
        pendingCases.forEach((caseData, index) => {
            doc.text(`Case Number: ${caseData.caseNumber}, NIC: ${caseData.nic}`, 20, 30 + (index * 10));
        });

        doc.save("case_report.pdf"); // Save the PDF
    };

    return (
        <div>
            <Header />
            <div className="cases-container">
                <h1>Cases</h1>
                {error && <p className="error-message">{error}</p>}
                <button onClick={generatePDF} className="btn btn-primary">Generate Report</button> {/* Button to generate report */}
                {cases.length > 0 ? (
                    <table className="cases-table">
                        <thead>
                            <tr>
                                <th>Case Number</th>
                                <th>NIC</th>
                                <th>Procedure</th>
                                <th>Court Type</th>
                                <th>Court Area</th>
                                <th>Monetary Value</th>
                                <th>Date</th>
                                <th>Nature</th>
                                <th>Status</th>
                            </tr>
                        </thead>
                        <tbody>
                            {cases.map((caseData) => (
                                <tr key={caseData._id}>
                                    <td>{caseData.caseNumber}</td>
                                    <td>{caseData.nic}</td>
                                    <td>{caseData.procedure}</td>
                                    <td>{caseData.courtType}</td>
                                    <td>{caseData.courtArea}</td>
                                    <td>{caseData.monetaryValue}</td>
                                    <td>{caseData.date}</td>
                                    <td>{caseData.nature}</td>
                                    <td>{caseData.status}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                ) : (
                    <p>No cases found for this NIC.</p>
                )}
            </div>
            <Footer />
        </div>
    );
}

export default ClientCase;
